window.bookSummaryJSON = "<p><b>Elorion is back from the vampire realm.</b></p> <p>Aeris and the girls have returned from training. The Head Mistress was true to her word. She kept them alive for a purpose.</p> <p>Joining the succubi has gained Elorion and Aeris an illusionary freedom at best, and it will come at a heavy price.</p> <p>There is no safety without power. No future without strength. Soon, they'll be leaving for the succubi capital. Sanctuary must progress or be abandoned.</p> <p>Will it become a city on a shining hill or be extinguished forever?</p>"; 
